# Mount Warren (Antarctica)

Mount Warren () is a mountain rising to  in Gromshin Heights, just north of the turn in Newcomer Glacier on the east side of northern Sentinel Range in Ellsworth Mountains, Antarctica.  It surmounts Newcomer Glacier to the west and south, and Vicha Glacier to the northeast.
The peak was named by the Advisory Committee on Antarctic Names (US-ACAN) for Aviation Master Sergeant Cecil O. Warren, U.S. Marine Corps (USMC), navigator on U.S. Navy (USN) Squadron VX-6 photographic flights over the range on Dec. 14â€“15, 1959.
